/// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0;

import "../interfaces/IBlast.sol";
import "../interfaces/IBlastPoints.sol";
import "../interfaces/IERC20Rebasing.sol";
import "../interfaces/IBlastConfigure.sol";

contract BlastConfigure is IBlastConfigure {
    IBlast public blast;
    IBlastPoints public blastPoints;
    IERC20Rebasing public usdb;
    IERC20Rebasing public weth;
    address public operator;

    modifier onlyOperator() {
        require(msg.sender == operator, "BlastConfigure: not operator");
        _;
    }

    constructor() public {}


    function initializeBlastConfig(
        address _blast,
        address _blastPoints,
        address _usdb,
        address _weth,
        address _operator
    ) public {
        require(address(blast) == address(0), "BlastConfigure: already initialized");
        blast = IBlast(_blast);
        blastPoints = IBlastPoints(_blastPoints);
        usdb = IERC20Rebasing(_usdb);
        weth = IERC20Rebasing(_weth);


        blast.configureClaimableYield();
        blast.configureClaimableGas();

        usdb.configure(IERC20Rebasing.YieldMode.CLAIMABLE);
        weth.configure(IERC20Rebasing.YieldMode.CLAIMABLE);

        blastPoints.configurePointsOperator(_operator);
        blast.configureGovernor(_operator);

    }

    function claimYield(address recipientOfYield) external onlyOperator {
        usdb.claim(recipientOfYield, usdb.getClaimableAmount(address(this)));
        weth.claim(recipientOfYield, weth.getClaimableAmount(address(this)));
    }

    function setOperator(address _operator) external onlyOperator {
        operator = _operator;
    }

}

